import React, { useState } from 'react';

function App() {
    const [formData, setFormData] = useState({
        id: '',
        firstName: '',
        lastName: '',
        amount: '',
        category: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // You can perform actions with the form data here, such as sending it to a server
        console.log(formData);
    };
    const [press,setPress] = useState(false)
    const handlePress = ()=>{
      setPress(!press)
    }

    return (
        <div>
            <form onSubmit={handleSubmit}>
                <b>your id       :</b><input type="number" name="id" value={formData.id} onChange={handleChange} /><br/><br/>
                <b>your first name:</b><input type="text" name="firstName" value={formData.firstName} onChange={handleChange} /><br/><br/>
                <b>your last name :</b><input type="text" name="lastName" value={formData.lastName} onChange={handleChange} /><br/><br/>
                <b>your amount    :</b><input type="number" name="amount" value={formData.amount} onChange={handleChange} /><br/><br/>
                <b>your category:</b><input type="text" name="category" value={formData.category} onChange={handleChange} /><br/><br/>
                <input type="submit" value="submit" onClick={handlePress}/>
            </form>
<div>

</div>

        </div>

    );
}

function Result({ expense }) {
    return (
        <html>
            <head>
                <style>
                    {`
                        label {
                            background-color: indigo;
                            color: rgb(169, 147, 189);
                        }
                        h1 {
                            color: yellow;
                        }
                    `}
                </style>
                <title>View Book</title>
            </head>
            <body>
                <div>
                    <h1>The Results....</h1>
                    <label htmlFor="id">{expense.id}</label><br/><br/>
                    <label htmlFor="firstName">{expense.firstName}</label><br/><br/>
                    <label htmlFor="lastName">{expense.lastName}</label><br/><br/>
                    <label htmlFor="amount">{expense.amount}</label><br/><br/>
                    <label htmlFor="category">{expense.category}</label><br/><br/>
                </div>
            </body>
        </html>
    );
}



export {App,Result};
